import React,{useState,useEffect} from 'react'

export default function CatPictures() {
  const [cats, setCats]= useState([])

  useEffect(() => {
    fetch('/api/cats?tags=tag1,tag2&skip=0&limit=10	')
    .then(response => response.json())
    .then(setCats)
  },[])
  return (
    <>
    {cats.map(cat => (
      <img src={cat} alt='cat' className='cat-img'/>
    )
    )}
    <div className="cat-img-div">
        <  img src="https://cataas.com/cat?width=300"  alt="catImg" className="cat-img"/>
        <  img src="https://cataas.com/cat?width=250"  alt="catImg" className="cat-img"/>
        <  img src="https://cataas.com/cat?width=280"  alt="catImg" className="cat-img"/>
        <  img src="https://cataas.com/cat?width=240"  alt="catImg" className="cat-img"/>
          <img src="https://cataas.com/api/cats?tags=cute"  alt="catImg"/>

    </div>
    </>
  )
}
